import { useEffect, useState } from 'react';
import './App.css';
import { getAllCars } from './services/carService';

function App() {

  const [cars, setCars] = useState([]);

  useEffect(() => {
    const getCars = async () => {
      const {data} = await getAllCars()

      setCars(data);
    }

    getCars()
  }, [])

  console.log("allCars: ", cars);


  return (
    <div className="App">
      <h1>Welcome to Cars App</h1>
    </div>
  );
}

export default App;
